import './Contact.css'
import React from 'react';
const Contact = () => {

    React.useEffect(() => {
        let top = document.querySelectorAll("input")
        let label = document.querySelectorAll("label")
        top.forEach(() => {
            top.addEventListener("input",)
        })
        top.addEventListener('input', () => {
            label.classList.remove("top");
        });
      }, []);

    return ( 
        <>
            <div className="mb-4">
                <div className="container">
                    <div className="star">
                        <div className="text-center pt-4">
                            <h2 className=' text-uppercase mb-3 fs-1 fw-bolder'>CONATCT SECTION</h2>
                            <div className='d-flex align-items-center justify-content-center mb-3'>
                                <div className='line me-3'></div>
                                <i className="fa-solid fa-star"></i>
                                <div className='line ms-3 '></div>
                            </div>
                        </div>
                    </div>
                    <form className=' w-50 p-3 mx-auto mt-5'>
                        <label htmlFor="userName" className=' position-relative top-0 top'>userName :</label>
                        <input type="text" id='userName' placeholder='userName' name='userName' className=' form-control border-0 border-bottom py-3 position-relative' />
                        <label htmlFor="userAge" className=' position-relative top-0 top'>userAge :</label>
                        <input type="text" id='userAge' placeholder='userAge' name='userAge' className=' form-control border-0 border-bottom py-3 position-relative' />
                        <label htmlFor="userEmail" className=' position-relative top-0 top'>userEmail :</label>
                        <input type="email" id='userEmail' placeholder='userEmail' name='userEmail' className=' form-control border-0 border-bottom py-3 position-relative' />
                        <label htmlFor="userPassword" className=' position-relative top-0 top'>userPassword :</label>
                        <input type="password" id='userPassword' placeholder='userPassword' name='userPassword' className=' form-control border-0 border-bottom py-3 position-relative' />
                        <button className='btn mt-4 text-white'>Send Message</button>
                    </form>
                </div>
            </div>
        </>
     );
}

export default Contact;
